import { Switch } from "react-router";
import { BrowserRouter } from "react-router-dom";
import { useEffect } from "react";
import { useDispatch } from "react-redux";

import { ComponentAppRoute } from "@components";
import { enumMedia, routes } from "@configs";
import { IMerchant, IRoute } from "@interfaces";
import { setMainColor, setMerchant } from "@redux";

// const merchant: IMerchant = {
//     name: "Gozzy Fruits",
//     themeColor: "#862929",
//     subColor: "#933131",
//     logoUrl: "/logo192.png",
//     signUpMethod: [enumMedia.FACEBOOK, enumMedia.GOOGLE],
// };

export const ModuleMain = () => {
    // page hooks
    const dispatch = useDispatch();
    useEffect(() => {
        dispatch(setMerchant(merchant));
        dispatch(setMainColor(merchant.themeColor));
    }, []);

    return (
        <BrowserRouter>
            <Switch>
                {routes.map((e: IRoute, key) => (
                    <ComponentAppRoute key={key} {...e} />
                ))}
            </Switch>
        </BrowserRouter>
    );
};
